import React from "react";
import FakeBookings from "./data/fakeBookings.json";

const ShowAll = () => {
  return (
    <div className="table">
      <table>
        <thead>
          <tr>
            <th> Title </th>
            <th> First Name </th>
            <th> SureName </th>
            <th> Email </th>
            <th> Room Number </th>
            <th> CheckInDate </th>
            <th> CheckOutDate </th>
            <th> Nights </th>
          </tr>
        </thead>
        {FakeBookings.map((booking, index) => {
          return (
            <tbody key={index} id={booking.id}>
              <tr>
                <td>{booking.title}</td>
                <td>{booking.firstName}</td>
                <td>{booking.surname}</td>
                <td>{booking.email}</td>
                <td>{booking.roomId}</td>
                <td>{booking.checkInDate}</td>
                <td>{booking.checkOutDate}</td>
                <td>
                <Nights timeline={booking.checkInDate}  timeout={booking.checkOutDate} />
                </td>
              </tr>
            </tbody>
          );
        })}
      </table>
    </div>
  );
};

export default ShowAll;
